import React from "react";
import { useState, useEffect } from "react";
import FileUpload from "../fileUpload/FileUpload.jsx";
import { API } from "../util/api/Api.js";
import "../../../node_modules/bootstrap/dist/css/bootstrap.min.css";
let api = new API();

function CronDetails(props) {
  const [records, setRecords] = useState([]);
  const [isFileUploaded, setFileUploaded] = useState(false);

  useEffect(() => {
    getEntries();
    console.log("Cron Input form page reloaded");
    //eslint-disable-next-line
  }, [isFileUploaded]);

  const getEntries = () => {
    return new Promise((resolve) => {
      api
        .getRecords()
        .then((res) => {
          setRecords(res.data.message);
        })
        .catch((err) => {
          console.log(err);
        });
    });
  };

  return (
    <div>
      <FileUpload uploadFlag={{ set: setFileUploaded, get: isFileUploaded }} />
      {records.length > 0 ? (
        <div>
          <table className="table table-striped table-hover">
            <tbody>
              <tr>
                {Object.keys(records[0]).map((element) => {
                  return <th>{element}</th>;
                })}
              </tr>
              {records.map((val, key) => {
                return (
                  <tr key={key}>
                    {Object.values(val).map((value) => {
                      return <td>{value}</td>;
                    })}
                  </tr>
                );
              })}
            </tbody>
          </table>
        </div>
      ) : (
        ""
      )}
      <form class="form-floating">
        <input
          type="email"
          className="form-control is-invalid"
          id="floatingInputInvalid"
          placeholder="name@example.com"
          value=''
        />
        <label for="floatingInputInvalid">Validate Cron</label>
      </form>
    </div>
  );
}

export default CronDetails;
